                                svg#freepik_stories-static-website:not(.animated) .animable {
                                    opacity: 0;
                                }

                                svg#freepik_stories-static-website.animated #freepik--background-complete--inject-61 {
                                    animation: 2.5s 1 forwards ease-in zoomOut;
                                    animation-delay: 0s;
                                }

                                svg#freepik_stories-static-website.animated #freepik--Floor--inject-61 {
                                    animation: 3.0s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) fadeIn;
                                    animation-delay: 0.0s;
                                }

                                svg#freepik_stories-static-website.animated #freepik--Server--inject-61 {
                                    animation: 3.0s 1 forwards ease-in slideRight;
                                    animation-delay: 0s;
                                }

                                svg#freepik_stories-static-website.animated #freepik--Device--inject-61 {
                                    animation: 3.0s 1 forwards ease-in fadeIn;
                                    animation-delay: 0s;
                                }

                                svg#freepik_stories-static-website.animated #freepik--Window--inject-61 {
                                    animation: 3.0s 1 forwards ease-in slideDown;
                                    animation-delay: 0s;
                                }

                                svg#freepik_stories-static-website.animated #freepik--Documents--inject-61 {
                                    animation: 3.0s 1 forwards ease-in slideLeft;
                                    animation-delay: 0s;
                                }

                                @keyframes zoomOut {
                                    0% {
                                        opacity: 0;
                                        transform: scale(1.5);
                                    }

                                    100% {
                                        opacity: 1;
                                        transform: scale(1);
                                    }
                                }

                                @keyframes fadeIn {
                                    0% {
                                        opacity: 0;
                                    }

                                    100% {
                                        opacity: 1;
                                    }
                                }

                                @keyframes slideRight {
                                    0% {
                                        opacity: 0;
                                        transform: translateX(30px);
                                    }

                                    100% {
                                        opacity: 1;
                                        transform: translateX(0);
                                    }
                                }

                                @keyframes slideDown {
                                    0% {
                                        opacity: 0;
                                        transform: translateY(-30px);
                                    }

                                    100% {
                                        opacity: 1;
                                        transform: translateY(0);
                                    }
                                }

                                @keyframes slideLeft {
                                    0% {
                                        opacity: 0;
                                        transform: translateX(-30px);
                                    }

                                    100% {
                                        opacity: 1;
                                        transform: translateX(0);
                                    }
                                }
